package com.lg.algo.leetcode;

import java.util.HashMap;
import java.util.Map;

//242. Valid Anagram
//https://leetcode.com/problems/valid-anagram
public class ValidAnagram {

    public static void main(String[] args) {
        ValidAnagram validAnagram = new ValidAnagram();

//        String s = "anagram", t = "nagaram";
//        String s = "ac", t = "bb";
        String s = "";
        String t = "";

        System.out.println(validAnagram.isAnagram(s, t));
        System.out.println(validAnagram.isAnagramShorterSolution(s, t));
    }

    public boolean isAnagram(String s, String t) {
        if (s.length() != t.length()) return false;

        Map<Character, Integer> sLettersCount = new HashMap<>();
        Map<Character, Integer> tLettersCount = new HashMap<>();

        for(int i = 0; i < s.length(); i++) {
            char sLetter = s.charAt(i);
            if(sLettersCount.containsKey(sLetter)) {
                Integer value = sLettersCount.get(sLetter);
                sLettersCount.put(sLetter, value + 1);
            } else {
                sLettersCount.put(sLetter, 1);
            }

            char tLetter = t.charAt(i);
            if(tLettersCount.containsKey(tLetter)) {
                Integer value = tLettersCount.get(tLetter);
                tLettersCount.put(tLetter, value + 1);
            } else {
                tLettersCount.put(tLetter, 1);
            }
        }

        if (sLettersCount.size() == tLettersCount.size()) {
            for(Character letter : sLettersCount.keySet()) {
                if(!(sLettersCount.get(letter).equals(tLettersCount.get(letter)))) return false;
            }
            return true;

        }

        return false;
    }

    public boolean isAnagramShorterSolution(String s, String t) {
        if (s.length() != t.length()) return false;

        int[] sLetters = new int[26];
        int[] tLetters = new int[26];

        for(int i = 0; i < s.length(); i++) {
            sLetters[(int)s.charAt(i) - 97]++;
            tLetters[(int)t.charAt(i) - 97]++;
        }

        for(int i = 0; i < 26; i++) {
            if (sLetters[i] != tLetters[i]) return false;
        }

        return true;
    }
}
